    //                 </tr>
    //                 </tbody>
    //
    //             </table>
    //         )
    //     }else {
    //         return null;
    //     }
    //
    // })

    const listItem = item.map(item => {

        return item.age > 20 ? (

            <table key={item.id}>
                <tbody>
                <tr>
                    <td>Name: {item.name}</td>
                    <td>Age: {item.age}</td>
                    <td>Sex: {item.sex}</td>
                </tr>
                </tbody>

            </table>
        ) : null;
    });

    return (

        <div className={'navbar'}>
            {listItem}
        </div>

    );

}

export default Navbar;
